    \ Nom rapide4. Rap Lyrics6. Band Name7. Username8. Fantasy Name9. Story10. Freestyle\
    \ Song Lyrics\n\nG\xE9n\xE9rateur de terrain\n\n\n\nNon sauv\xE9 Jump to options\
    \ for sharing, commenting and voting.\nHungry Obfus Curr\nUne histoire courte\n\
    par Jim\nObfus Curr regarda le couteau dans ses mains et se sentit effray\xE9\
    .\nIl est pass\xE9 \xE0 la fen\xEAtre et r\xE9fl\xE9chit sur son environnement\
    \ effrayant. Il avait toujours aim\xE9 le pittoresque Falmouth avec ses foss\xE9\
    s perturb\xE9s et vertigineux. C'\xE9tait un endroit qui a encourag\xE9 sa tendance\
    \ \xE0 se sentir effray\xE9.\nPuis il a vu quelque chose \xE0 distance, ou plut\xF4\
    t quelqu'un. C'\xE9tait la figure d'Ambien Cain. Ambien \xE9tait un \xE9l\xE9\
    phant aimant avec de larges verrues et des cils spiky.\nObfus gulp\xE9. Il a regard\xE9\
    \ sa propre r\xE9flexion. C'\xE9tait un buveur de vin affam\xE9, intelligent,\
    \ avec de beaux verrues et des cils bruns. Ses amis l'ont vu comme un grand regard,\
    \ sauvage et murmure. Une fois, il avait m\xEAme relanc\xE9 un oiseau mort et\
    \ bless\xE9. Mais m\xEAme pas une personne affam\xE9e qui avait une fois relanc\xE9\
    \ un oiseau meurtri et bless\xE9, \xE9tait pr\xE9par\xE9e pour ce qu'Ambi avait\
    \ en magasin aujourd'hui. La pluie martelait comme des oiseaux ronflants, faisant\
    \ de l'Obous ambivalent.\nComme Obfus s'est approch\xE9 dehors et Ambien s'est\
    \ rapproch\xE9, il a pu voir le sourire qui lui \xE9tait propre.\n\"Je suis ici\
    \ parce que je veux la justice\", aveugl\xE9 Ambien, dans un ton doux. Il a frapp\xE9\
    \ son poing contre la poitrine d'Oboufus, avec la force de 5874 bouteilles bleues.\
    \ \"Je t'aime, Obfus Curr\".\nObfus a regard\xE9 en arri\xE8re, encore plus ambivalent\
    \ et doigtant toujours le couteau particulier. \"Ambien, je n'ai pas l'argent\"\
    , r\xE9pondit-il.\nIls se regardaient l'un l'autre avec des sentiments actifs,\
    \ comme deux magnifiques maggots immobiles riant d'un bar mitzvah tr\xE8s pris\xE9\
    , qui avait de la musique classique jouer en arri\xE8re-plan et deux oncles soign\xE9\
    s pensant au rythme.\nObfus a \xE9tudi\xE9 les larges verrues d'Ambien et les\
    \ cils spiky. Finalement, il a pris une profonde respiration. \"Je suis d\xE9\
    sol\xE9, mais je ne peux pas vous rendre justice\", a-t-il expliqu\xE9, dans des\
    \ tons pitoyables.\nAmbien semblait irritable, son corps cru comme une carte moderne\
    \ et puissante.\nObfus a pu entendre le corps d'Ambien en 3833 morceaux. Puis\
    \ l'\xE9l\xE9phant aimant s'est enfonc\xE9 dans la distance. M\xEAme pas un verre\
    \ de vin calmerait les nerfs d'Obous ce soir.\nFIN\n\nPour des raisons de confidentialit\xE9\
    , votre cr\xE9ation sera supprim\xE9e du web \xE0 8h30 de la BST et supprim\xE9\
    e plus tard de notre serveur, \xE0 moins que vous ne le d\xE9cidez de le publier.\n\
    ou\n\n\n\n\n(Les cr\xE9ations limit\xE9es sont disponibles pour quiconque avec\
    \ le lien.) Le vote et les commentaires sont disponibles uniquement sur les travaux\
    \ publi\xE9s.\nAuto Praise for Hungry Obfus Curr\n\"J'ai l'impression de conna\xEE\
    tre Obfus Curr. D'une certaine mani\xE8re, c'est comme si je l'avais toujours\
    \ connu\".\n- Le Daily Tale\n\"\xC0 propos aussi agr\xE9able que d'\xEAtre jet\xE9\
    \ sur tout en prenant dans le lavage qui a \xE9t\xE9 cibl\xE9 par les mouettes\
