  div1626256393.394728: "Non sauv\xE9 Jump to options for sharing, commenting and\
    \ voting.\nHungry Obfus Curr\nUne histoire courte\npar Jim\nObfus Curr regarda\
    \ le couteau dans ses mains et se sentit effray\xE9.\nIl est pass\xE9 \xE0 la\
    \ fen\xEAtre et r\xE9fl\xE9chit sur son environnement effrayant. Il avait toujours\
    \ aim\xE9 le pittoresque Falmouth avec ses foss\xE9s perturb\xE9s et vertigineux.\
    \ C'\xE9tait un endroit qui a encourag\xE9 sa tendance \xE0 se sentir effray\xE9\
    .\nPuis il a vu quelque chose \xE0 distance, ou plut\xF4t quelqu'un. C'\xE9tait\
    \ la figure d'Ambien Cain. Ambien \xE9tait un \xE9l\xE9phant aimant avec de larges\
    \ verrues et des cils spiky.\nObfus gulp\xE9. Il a regard\xE9 sa propre r\xE9\
    flexion. C'\xE9tait un buveur de vin affam\xE9, intelligent, avec de beaux verrues\
    \ et des cils bruns. Ses amis l'ont vu comme un grand regard, sauvage et murmure.\
    \ Une fois, il avait m\xEAme relanc\xE9 un oiseau mort et bless\xE9. Mais m\xEA\
    me pas une personne affam\xE9e qui avait une fois relanc\xE9 un oiseau meurtri\
    \ et bless\xE9, \xE9tait pr\xE9par\xE9e pour ce qu'Ambi avait en magasin aujourd'hui.\
    \ La pluie martelait comme des oiseaux ronflants, faisant de l'Obous ambivalent.\n\
    Comme Obfus s'est approch\xE9 dehors et Ambien s'est rapproch\xE9, il a pu voir\
    \ le sourire qui lui \xE9tait propre.\n\"Je suis ici parce que je veux la justice\"\
    , aveugl\xE9 Ambien, dans un ton doux. Il a frapp\xE9 son poing contre la poitrine\
    \ d'Oboufus, avec la force de 5874 bouteilles bleues. \"Je t'aime, Obfus Curr\"\
    .\nObfus a regard\xE9 en arri\xE8re, encore plus ambivalent et doigtant toujours\
    \ le couteau particulier. \"Ambien, je n'ai pas l'argent\", r\xE9pondit-il.\n\
